function ExpenseItem(props) {
  return (
    <div className="expense_item">
      <div className="expense_item__date">August 2020 14</div>
      <div className="expense_item__title">Health Insurance</div>
      <div className="expense_item__amount">${90 + 4.12}</div>
    </div>
  );
}

export default ExpenseItem;
